import Link from "next/link";

export default () => (
  <header>
    <nav>
      <h1>Killerpedia</h1>
      <ul>
        <li>
          <Link href="/">
            <a>Male killers</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Female killers</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Country</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Serial Killers</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Mass murderers</a>
          </Link>
        </li>
      </ul>
      <style jsx>{`
        nav {
          max-width: 1400px;
          margin: 0 auto;
          display: flex;
          align-items: center;
          text-transform: uppercase;
        }

        ul {
          margin: 0;
          padding: 0;
          display: flex;
          list-style: none;
          justify-content: space-between;
        }

        li {
          margin-right: 1rem;
        }

        a {
          font-weight: 300;
          font-size: 14px;
          color: inherit;
          text-decoration: none;
          transition: all 0.2s;
        }

        a:hover {
          color: white;
        }

        span {
          margin-right: 1rem;
        }

        h1 {
          font-size: 2rem;
          margin: 4px 0;
          flex: 1;
        }
      `}</style>
    </nav>
  </header>
);
